local ground = 118367369949006
local katx = 111163066268338

local placeId = game.PlaceId

if placeId ~= ground and placeId ~= katx then
    game.Players.LocalPlayer:Kick("Invalid place")
    return
end

local function verifyHook()
    if type(hookfunction) ~= "function" then 
        return false, "hookfunction missing" 
    end
    
    local testFunc = function() return "original" end
    local success, result = pcall(function()
        local original = hookfunction(testFunc, function() return "hooked" end)
        local output = testFunc()
        if original then 
            hookfunction(testFunc, original) 
        end
        return output
    end)
    
    if not success or result ~= "hooked" then 
        return false, "hookfunction not working" 
    end
    
    return true
end

local verified, errorMsg = verifyHook()
if not verified then
    game.Players.LocalPlayer:Kick("Detection failed")
    return
end

